    def pullData(self):
        url = "https://www.opengeodata.nrw.de/produkte/umwelt_klima/klima/kwp/KWP-NRW-Waermelinien_EPSG25832_Geodatabase.zip"
        response = requests.get(url)
        if response.status_code == 200:
            z = zipfile.ZipFile(io.BytesIO(response.content))
            logging.log(logging.INFO, "Downloaded the KWP NRW WL ZIP file")

            if not os.path.exists(
                os.path.join(os.path.dirname(__file__)) + "\data\kwp_nrw_wl"
            ):
                z.extractall(
                    os.path.join(os.path.dirname(__file__)) + "\data\kwp_nrw_wl"
                )
                logging.log(logging.INFO, "Extracted KWP NRW WL GDB")
            else:
                logging.log(logging.INFO, "KWP NRW WL GDB already exists")

            return True
        else:
            log.info("Failed to download the ZIP file")
            return False

